import React from "react";
import Navbar from "../components/Navbar";
import BreadCrumb from "../components/BreadCrumb";

function CartPage() {
  return (
    <div>
      <Navbar />
      <BreadCrumb />
      <div className="container">
        <h3
          style={{
            textAlign: "center",
            backgroundColor: "white",
            color: "black",
            padding
          }}
        >
          GIỎ HÀNG CỦA BẠN
        </h3>
      </div>
    </div>
  );
}

export default CartPage;
